INSERT INTO routes VALUES ('197a9564-698d-4e33-999f-2ea768095d15', 'f3496f46-b1a2-4d8e-8681-d44f0d179991', 'Zabytki Torunia', 'Odkryj Toruń, zaczynając od Pomnika Kopernika, następnie zwiedź gotycki Ratusz Staromiejski i Krzywą Wieżę, zakończ na majestatycznej Katedrze św. Janów. Trasa łączy historię miasta z fascynującymi legendami.', '\');
INSERT INTO routes VALUES ('1c7d1c35-ba15-43dd-928e-e8a86381317a', 'f3496f46-b1a2-4d8e-8681-d44f0d179991', 'Zabytki Gdańska', 'Poznaj Gdańsk, zaczynając od Fontanny Neptuna, przez zabytkowy Żuraw i Bazylikę Mariacką, aż po odnowioną Wyspę Spichrzów. Trasa ukazuje historyczną głębię miasta i jego współczesne odrodzenie.', '\');
